    ('9ba179ed-d26d-4828-a0f6-8836c2063992', '2589a5b7-94c9-4a76-86d9-576718ca63c3', 'b6484e21-6937-489c-b031-b71767994738', 'template', 'Robber', E'<p>You are given a list of non-negative integers representing the amount of money of each house in a row of houses. Each house has a certain amount of money stashed, but you cannot rob two adjacent houses at the same time because the police will be alerted. Your task is to determine the maximum amount of money you can rob tonight without alerting the police.</p><p>Example 1:</p><pre class=\"ql-syntax\" spellcheck=\"false\">Input: \r\n4\r\n1 2 3 1\r\nOutput: 4\r\nExplanation: Rob house 1 (money = 1) and then rob house 3 (money = 3). Total amount = 1 + 3 = 4.\r\n</pre>', '<p>The first line is the number n indicate the number of house.</p><p>The second line is an array A, A[i] indicate the money of the house i.</p>', '<p>The maximum amount of money you can rob.</p>', 'CREATED', '', '<p>0 < n <= 10000</p><p>0 <= A[i] <= 400</p>', 10, 'MEDIUM');
