    ('9ba179ed-d26d-4828-a0f6-8836c2063992', '2dbe940c-8d25-4a88-a283-d79785c1ea2a', 'b6484e21-6937-489c-b031-b71767994739', 'template', 'Three sum closest', E'<p>You are given an array <code>nums</code> of integers. Write a function to find three numbers in <code>nums</code> such that the sum is closest to a given target <code>target</code>. Return the sum of the three integers. You may assume that each input would have exactly one solution.</p><p>Example:</p><pre class=\"ql-syntax\" spellcheck=\"false\">Input:\r\n4\r\n-1 2 1 -4\r\n1\r\nOutput: 2\r\nExplanation: The sum that is closest to the target is 2. (-1 + 2 + 1 = 2).\r\n</pre>', '<p>The first line is number n indicate the number of element of <code>nums</code> </p><p>The second line is an array <code>nums</code> </p><p>The third line is a <code>target</code> number</p>', '<p>Return the sum of the three integers closest to the <code>target</code>.</p>', 'CREATED', '', '<p><code>3 &lt;= nums.length &lt;= 10^3</code></p><p><code>-10^3 &lt;= nums[i] &lt;= 10^3</code></p><p><code>-10^4 &lt;= target &lt;= 10^4</code></p>', 10, 'MEDIUM');
